    Determines the winner of the game between "Me" and "Grinch" given the integer N.

    Parameters:
    N (int): The integer value for the game.

    Returns:
    str: The winner of the game, either "Me" or "Grinch".
    """
    if N == 1:
        return 'Grinch'
    elif N & 1 or N == 2:
        return 'Me'
    else:
        tmp = N
        val = 1
        while tmp > 1 and tmp % 2 == 0:
            tmp //= 2
            val *= 2
        cnt = 0
        for i in range(3, int(math.sqrt(tmp)) + 1):
            while tmp % i == 0:
                cnt += 2
                tmp //= i
        if tmp > 1:
            cnt += 1
        if val == N:
            return 'Grinch'
        elif N / tmp == 2 and cnt == 1:
            return 'Grinch'
        else:
            return 'Me'

